        {
            //Input: "abcabcbb"
            //Output: 3
            Assert.AreEqual(
                LongestSubstringWithoutRepeatingCharacters.Solution.LengthOfLongestSubstring("abcabcbb"),
                3);
        }
        [TestMethod]
        public void MyTestMethod1()
        {
            //Input: "bbbbb"
            //Output: 1
            Assert.AreEqual(
                LongestSubstringWithoutRepeatingCharacters.Solution.LengthOfLongestSubstring("bbbbb"),
                1);
        }
        [TestMethod]
        public void MyTestMethod2()
        {
            //Input: "pwwkew"
            //Output: 3
            Assert.AreEqual(
                LongestSubstringWithoutRepeatingCharacters.Solution.LengthOfLongestSubstring("pwwkew"),
                3);
        }

